  true,\n\t\"url\": null,\n\t\"notes\": \"A partnership with the Natural Energy Laboratory
  of Hawaii Authority and U.S. Department of Energy's National Renewable Energy Laboratory
  (NREL) to collect solar data to support future solar power generation in the United
  States. The measurement station monitors global horizontal horizontal irradiance
  to define the amount of solar energy that hits this particular location. The solar
  measurement instrumentation is also accompanied by meteorological monitoring equipment
  to provide scientists with a complete picture of the solar power possibilities.
